dgets.'=>'Виджеты Ocean WordPress добавляют дополнительные параметры, которые вы можете использовать в областях виджетов WordPress по умолчанию, таких как боковые панели и подвал. Добавьте виджеты через Внешний вид > Виджеты.','OceanWP'=>'OceanWP','OceanWP Child Theme'=>'Дочерняя тема OceanWP','OceanWP Google fonts not rendering on frontend of your website when using the theme option to load Google fonts locally? If you have recently made any SSL or website URL changes, use the "Clear Data" button to regenerate local CSS files and fix the font rendering issue.'=>'Шрифты OceanWP Google не отображаются на внешнем интерфейсе вашего веб-сайта при использовании опции темы для локальной загрузки шрифтов Google? Если вы недавно вносили какие-либо изменения в SSL или URL-адрес веб-сайта, используйте кнопку Очистить данные, чтобы повторно сгенерировать локальные файлы CSS и устранить проблему с отображением шрифта.','OceanWP Panel'=>'Панель OceanWP','OceanWP Theme Setting'=>'Настройки темы OceanWP','OceanWP is the perfect theme for your project. Lightweight and highly extendable, it will enable you to create almost any type of website such a blog, portfolio, business website and WooCommerce storefront with a beautiful & professional design. Very fast, responsive, RTL & translation ready, best SEO practices, unique WooCommerce features to increase conversion and much more. You can even edit the settings on tablet & mobile so your site looks good on every device. Work with the most popular page builders as Elementor, Beaver Builder, Brizy, Visual Composer, Divi, SiteOrigin, etc... Developers will love his extensible codebase making it a joy to customize and extend. Best friend of Elementor & WooCommerce. Looking for a Multi-Purpose theme? Look no further! Check the demos to realize that it\'s the only theme you will ever need: https://oceanwp.org/demos/'=>'OceanWP это идеальная тема для ваших проектов. Легко и хорошо расширяемая, эта тема позволит вам создавать почти любой тип